import React from 'react';
import ReactDOM from 'react-dom';


class CountrySelector extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {

    return (
      <form defaultValue="Nederland">
          <select value={this.state.country}>
            <option value="Nederland">Nederland</option>
            <option value="China">China</option>
          </select>
      </form>
    );
  }
}
ReactDOM.render("Select a country" + <CountrySelector />, document.getElementById('selectCountryForm'));


ReactDOM.render("CountrySelector" , document.getElementById('test'));
